function SearchForm() {
  return (
    <div className='searchForm'>
      <div className='searchForm__searchLine'>
        <input className='searchForm__input'></input>
        <button className='searchForm__button'>Найти</button>
      </div>
      <div className='searchForm__tumbler'>
        <p className='searchForm_short'>Короткометражки</p>
      </div>
    </div>
  );
}

export default SearchForm;
